import React from "react";

class SignUp extends React.Component {
  constructor() {
    super();

    this.state = {
      email: "",
      password: "",
      confirmPassword: "",
    };
  }

  render() {
    return <div>Sign Up</div>;
  }
}

export default SignUp;
